import styled from "styled-components";
import { IMembershipTier } from "@interfaces";

interface IProps {
    membershipTier: IMembershipTier;
}

export const ComponentCurrentPoint = (props: IProps) => {
    //page props
    const { membershipTier } = props;
    console.log(membershipTier);
    return (
        <StyledCurrentPoint>
            <div className="content"></div>
        </StyledCurrentPoint>
    );
};

const StyledCurrentPoint = styled.div`
    height: 100vh;
    width: 100%;
    position: fixed;
    top: 0;
    display: flex;
    align-items: center;
    justify-content: center;
    max-width: 480px;
    background: rgba(0, 0, 0, 0.5);
`;
